import{_ as a}from"./chunks/sadulli_top.DXtdLYRR.js";import{_ as r,c as t,a8 as o,o as n}from"./chunks/framework.BDnHobkS.js";const m=JSON.parse('{"title":"Zubax Telega ESCs","description":"","frontmatter":{},"headers":[],"relativePath":"uk/dronecan/zubax_telega.md","filePath":"uk/dronecan/zubax_telega.md"}'),i={name:"uk/dronecan/zubax_telega.md"};function s(l,e,u,c,d,h){return n(),t("div",null,e[0]||(e[0]=[o('<h1 id="zubax-telega-escs" tabindex="-1">Zubax Telega ESCs <a class="header-anchor" href="#zubax-telega-escs" aria-label="Permalink to &quot;Zubax Telega ESCs&quot;">​</a></h1><p>Zubax Telega - це високотехнологічна, власна технологія бездатчикового керування двигуном FOC. It is used in multiple products, including the <a href="https://zubax.com/products/myxa" target="_blank" rel="noreferrer">Zubax Myxa</a> ESC, <a href="https://zubax.com/products/mitochondrik" target="_blank" rel="noreferrer">Zubax Mitochondrik</a> motor controller module, and Zubax Sadulli integrated drive.</p><p>While Telega can be controlled using traditional PWM input, it is designed to operate over CAN bus using <a href="./">DroneCAN</a>.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>ESCs based on Zubax Telega require non-trivial tuning of the propulsion system in order to deliver adequate performance and ensure robust operation. Users who lack the necessary tuning expertise are advised to either <a href="https://zubax.com/products/uav_propulsion_kits" target="_blank" rel="noreferrer">purchase pre-tuned UAV propulsion kits</a> or to use Zubax Robotic&#39;s professional tuning service. Questions on this matter should be addressed to: <a href="mailto:support@zubax.com" target="_blank" rel="noreferrer">support@zubax.com</a>.</p></div><p><img src="'+a+'" alt="Sadulli - Top"></p><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><ul><li><a href="https://zubax.com/products/myxa" target="_blank" rel="noreferrer">Zubax Myxa</a>: High-end PMSM/BLDC motor controller (FOC ESC) for light unmanned aircraft and watercraft.</li><li><a href="https://zubax.com/products/mitochondrik" target="_blank" rel="noreferrer">Zubax Mitochondrik</a>: Integrated sensorless PMSM/BLDC motor controller chip (used in ESCs and integrated drives)</li><li><a href="https://shop.zubax.com/products/komar-motor-controller-open-hardware-reference-design-for-mitochondrik?variant=32931555868771" target="_blank" rel="noreferrer">Zubax Komar</a>: Open hardware reference design for Mitochondrik</li><li><a href="https://shop.zubax.com/collections/integrated-drives/products/sadulli-integrated-drive-open-hardware-reference-design-for-mitochondrik?variant=27740841181283" target="_blank" rel="noreferrer">Zubax Sadulli Integrated Drive</a></li></ul><h2 id="налаштування-програмного-забезпечення" tabindex="-1">Налаштування програмного забезпечення <a class="header-anchor" href="#налаштування-програмного-забезпечення" aria-label="Permalink to &quot;Налаштування програмного забезпечення&quot;">​</a></h2><p>ESCs підключені до шини CAN за допомогою стандартного кабелю Pixhawk 4 pin JST GH. For more information, refer to the <a href="./../can/#wiring">CAN Wiring</a> instructions. Порядок ESC не має значення.</p><h2 id="налаштування-прошивки" tabindex="-1">Налаштування прошивки <a class="header-anchor" href="#налаштування-прошивки" aria-label="Permalink to &quot;Налаштування прошивки&quot;">​</a></h2><p>Motor enumeration for <a href="https://zubax.com/products/telega" target="_blank" rel="noreferrer">Telega-based ESCs</a> is usually performed using the <a href="https://files.zubax.com/products/com.zubax.kucher/" target="_blank" rel="noreferrer">Kucher tool</a> (or less &quot;GUI-friendly&quot; <a href="https://dronecan.github.io/GUI_Tool/Overview/" target="_blank" rel="noreferrer">DroneCAN GUI Tool</a>). Telega НЕ підтримує автоматичне перелічення, приводячи в рух двигун.</p><p>There is some guidance here: <a href="https://forum.zubax.com/t/quick-start-guide-for-myxa-v0-1/911" target="_blank" rel="noreferrer">Quick start guide for Myxa v0.1</a> (Zubax blog).</p><p>Також для надійної продуктивності регулятори швидкості Telega потребують іншої налаштування та конфігурації двигуна. Дивіться вищезазначений посібник та іншу документацію Zubax для отримання додаткової інформації.</p><h2 id="налаштування-польотного-контролера" tabindex="-1">Налаштування польотного контролера <a class="header-anchor" href="#налаштування-польотного-контролера" aria-label="Permalink to &quot;Налаштування польотного контролера&quot;">​</a></h2><h3 id="увімкнути-dronecan" tabindex="-1">Увімкнути DroneCAN <a class="header-anchor" href="#увімкнути-dronecan" aria-label="Permalink to &quot;Увімкнути DroneCAN&quot;">​</a></h3><p>Підключіть ESC до шини CAN Pixhawk. Power up the entire vehicle using a battery or power supply (not just the flight controller over USB) and enable the DroneCAN driver by setting the parameter <a href="./../advanced_config/parameter_reference.html#UAVCAN_ENABLE">UAVCAN_ENABLE</a> to <code>3</code> to enable both dynamic node ID allocation and DroneCAN ESC output.</p><h3 id="конфігурація-px4" tabindex="-1">Конфігурація PX4 <a class="header-anchor" href="#конфігурація-px4" aria-label="Permalink to &quot;Конфігурація PX4&quot;">​</a></h3><p>Assign motors to outputs using the <a href="./../config/actuators.html#actuator-testing">Acutator</a> configuration screen.</p><h2 id="усунення-проблем" tabindex="-1">Усунення проблем <a class="header-anchor" href="#усунення-проблем" aria-label="Permalink to &quot;Усунення проблем&quot;">​</a></h2><h3 id="двигуни-не-крутяться-під-час-увімкнення" tabindex="-1">Двигуни не крутяться під час увімкнення <a class="header-anchor" href="#двигуни-не-крутяться-під-час-увімкнення" aria-label="Permalink to &quot;Двигуни не крутяться під час увімкнення&quot;">​</a></h3><p>If the PX4 Firmware arms but the motors do not start to rotate, check that parameter <code>UAVCAN_ENABLE=3</code> to use DroneCAN ESCs. If the motors do not start spinning before thrust is increased, use <a href="./../config/actuators.html#actuator-testing">Acutator &gt; Actuator Testing</a> to confirm that the motor outputs are set to the correct minimum values.</p><h3 id="пристроі-dronecan-не-отримують-ідентифікатор-вузла-оновлення-прошивки-не-вдається" tabindex="-1">Пристрої DroneCAN не отримують ідентифікатор вузла/Оновлення прошивки не вдається <a class="header-anchor" href="#пристроі-dronecan-не-отримують-ідентифікатор-вузла-оновлення-прошивки-не-вдається" aria-label="Permalink to &quot;Пристрої DroneCAN не отримують ідентифікатор вузла/Оновлення прошивки не вдається&quot;">​</a></h3><p>PX4 вимагає SD-карту для виділення вузла DroneCAN та під час оновлення вбудованого програмного забезпечення (яке відбувається під час завантаження). Перевірте, що вставлена (працююча) SD-карта присутня і перезавантажте пристрій.</p>',23)]))}const f=r(i,[["render",s]]);export{m as __pageData,f as default};
